import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { embedDashboard } from "@superset-ui/embedded-sdk";

export default function SupersetComponent() {
    const config = {
        id: "12",
        supersetDomain: "http://192.168.14.19:8088",
        mountPoint: document.getElementById("container-fluid"), // any html element that can contain an iframe
        // fetchGuestToken: () => fetchGuestTokenFromBackend(),
        dashboardUiConfig: { hideTitle: true }, // dashboard UI config: hideTitle, hideTab, hideChartControls (optional)
    }
    /* JS code goes here */
    /* http://superset.zone.ps:8088/superset/dashboard/12 */
    return (
        embedDashboard({
            id: "abc123", // given by the Superset embedding UI
            supersetDomain: "https://superset.example.com",
            mountPoint: document.getElementById("my-superset-container"), // any html element that can contain an iframe
            fetchGuestToken: () => fetchGuestTokenFromBackend(),
            dashboardUiConfig: { hideTitle: true }, // dashboard UI config: hideTitle, hideTab, hideChartControls (optional)
          })
        // <iframe width="100%" height="800" frameBorder="0" src="https://superset.zone.ps/superset/dashboard/5/?standalone=true"> </iframe>
    )
}
